import React from 'react';
import ReactDOM from 'react-dom';
import { useState} from 'react';

const App = () => {
  const [counter, setCounter] = useState(0)
  setTimeout(
    () => setCounter( counter +1 ),
    1000
  )
  console.log("Rendering...",counter)

  return (
    <h2>{counter}</h2>

  )
}


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
